import React, {Component} from 'react';
import {Button,Dropdown,Menu} from 'semantic-ui-react';
import 'semantic-ui-css/semantic.min.css';
import './navbar.css';


let visualizeClicked = false;

class Navbar extends Component  {
    state = { 
                activeItem: 'home',
                //visualizeClicked : false,
           }

  handleItemClick = (e, { name }) => this.setState({ activeItem: name })
    
    handleVisualizeClick()
    {
        visualizeClicked = true;
    }
    render() {
        const { activeItem} = this.state;
        return (
            
            <div className = 'navbar'>
                
            <Menu inverted borderless size='huge'>
            <Menu.Item >
             <img size ='mini' src='/logo.png' />
            </Menu.Item>
            <Menu.Item header onClick ={() => this.handleVisualizeClick()} >Dijkstra Visualizer</Menu.Item>
            <Menu.Item
              name='home'
              active={activeItem === 'home'}
              
            />
            <Menu.Item
              name='messages'
              active={activeItem === 'messages'}
              
            />
            <Menu.Item className = "dijkstra-button" position = 'center'>
            <Button positive >Dijkstra Visualizer</Button>
            </Menu.Item>
              
          
    
            <Menu.Menu position='right' className ="dropdown">
              <Dropdown item text='Speed'>
                <Dropdown.Menu>
                  <Dropdown.Item>Fast</Dropdown.Item>
                  <Dropdown.Item>Average</Dropdown.Item>
                  <Dropdown.Item>Slow</Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>
              
              
            </Menu.Menu>
            </Menu>
            </div>
            
    
        );
    }
    
}

export default Navbar;
